import React from 'react';
import { useNavigate } from 'react-router-dom';

function SignUp()
{
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [userEmail, setUserEmail] = useState("");
    const [loginName, setLoginName] = useState("");
    const [loginPassword, setLoginPassword] = useState("");

    const doSignUp = async event => 
    {
        event.preventDefault();

        alert('SIGNING UP BUTTON CLICKED!');
    };

    return(
      <div class="box">
        <div id="loginDiv" class ="BoxContainer">
            <form class ="FormContainer" onSubmit={doSignUp}>
            <span id="inner-title"><h1>GAINZ<span class="textLogo">BOY</span></h1></span><br />
            <input type="text" id="firstName" placeholder="John" required/><br />
            <input type="text" id="lastName" placeholder="Smith" required/><br />
            <input type="email" id="userEmail" placeholder="123@example.com" required/><br />
            <input type="text" id="loginName" placeholder="Username" required/><br />
            <input type="password" id="loginPassword" placeholder="Password" required/><br />
            <input type="submit" id="loginButton" class="loginButton" value = "Sign Up"
            onClick={doSignUp} />
            </form>
            <a href="/" class="NewAccount">Already have an account?</a>
            <span id="loginResult"></span>
        </div>
        </div>  
      
    );
};

export default SignUp;
